import React from 'react';
import { Link, Routes, Route, Outlet } from 'react-router-dom';
import EmployeeProfile from './EmployeeProfile';
import EmployeePayroll from './EmployeePayroll';
import EmployeeLeave from './EmployeeLeave';

function EmployeeDashboard() {
  return (
    <div>
      <h2>Employee Dashboard</h2>
      <p>Profile, payroll, and leave.</p>

      <div className="list-group mb-3">
        <Link className="list-group-item list-group-item-action" to="profile">Profile</Link>
        <Link className="list-group-item list-group-item-action" to="payroll">Salary Slip</Link>
        <Link className="list-group-item list-group-item-action" to="leave">Leave Request</Link>
      </div>

      <Routes>
        <Route path="/" element={<EmployeeProfile />} />
        <Route path="profile" element={<EmployeeProfile />} />
        <Route path="payroll" element={<EmployeePayroll />} />
        <Route path="leave" element={<EmployeeLeave />} />
      </Routes>

      <Outlet />
    </div>
  );
}

export default EmployeeDashboard;
